import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import styles from '../styles/Footer.module.css';
import logoFooter from '../images/logo-footer.svg';
import appstoreImg from '../images/appstore.svg'
import googleplayImg from '../images/googleplay.svg'


function Footer() {
    return(
        <footer>
            <div><img src={ logoFooter } alt="Lev footer" /></div>
            <div>
                <p>Contatos</p>
                <p>Ajuda</p>
                <a href="mailto:contato.lev@gmail.com">contato.lev@gmail.com</a>
            </div>
            <div>
                <p>Baixe o app agora!</p>
                <img src= { appstoreImg } alt="" />
                <img src= { googleplayImg } alt="" />
            </div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
        </footer>
    );
}

export default Footer;
